import React from 'react'
import styled from 'styled-components'



function Home() {
    return (
        <Container >

            <ContainerInside>
                <p>----  GET HELP. GET BETTER.  ----</p>


            </ContainerInside>
            <ContainerInsider>

                <h6>A place to feel better, 
                   wherever you go!</h6>

            </ContainerInsider>



        </Container>
    )
}

export default Home
// min-height: calc(100vh - 70px);
// padding: 0 calc(3.5vw + 5px);
const ContainerInside = styled.main`

p{
    font-height:19px;
    width:522px;
    color:red;
    letter-spacing:5px;
    margin:155px 738px 510px 180px;

}


`




const ContainerInsider = styled.div`

h6{
    margin:24px 747px 376px 189px;
    color:red;
}

`

const Container = styled.div`
height:684px;
width:1440px;

position:relative;
overflow:hidden;

`
